        try {
            const res = await Axios({
                method: 'GET',
                url: "https://movie0706.cybersoft.edu.vn/api/QuanLyRap/LayThongTinLichChieuHeThongRap?maNhom=GP01"
            })
            dispatch({
                type: GET_LIST_SHOWTIME_DETAILTAB, // dipatch TabNavigationPageReducer
                payload: res.data
            })
        } catch (error) {
            console.log(error);
        }
    }
}
